import { createPage } from "../../utils/test-utils";
describe("duet-scrollable", () => {
    it("should render an duet-scrollable component", async () => {
        const page = await createPage(`<duet-scrollable><button></button><button></button><button></button><button></button><button></button></duet-scrollable>`);
        const component = await page.find("duet-scrollable");
        expect(component).not.toBeNull();
        expect(component).toHaveClass("hydrated");
    });
});
